import { useCookies } from "react-cookie";
import axios from "axios";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { addToLibrary } from "../slicers/like-slicer";

export function UserDashboard() {
  const [cookies] = useCookies(['userName']);
  const [videos, setVideos] = useState([]);
  const navigate = useNavigate();
  const dispatch = useDispatch();

  // Redux selectors
  const videosCount = useSelector(state => state.store.videosCount);
  const myLibrary = useSelector(state => state.store.MyVideoLibrary);

  // Load videos from backend
  function LoadVideos() {
    axios.get('http://127.0.0.1:3334/Videos')
      .then(response => {
        setVideos(response.data);
      })
      .catch(err => {
        console.error("Error loading videos:", err);
      });
  }

  // Redirect or load videos on mount
  useEffect(() => {
    if (!cookies['userName']) {
      navigate('/userlogin');
    } else {
      LoadVideos();
    }
  }, []);

  // Add video to library
  function handleSaveClick(video) {
    dispatch(addToLibrary(video));
  }

  return (
    <div>
      <h3>
        {cookies['userName']} - Dashboard
        <button
          data-bs-target="#library"
          data-bs-toggle="modal"
          className="btn btn-warning position-relative bi bi-camera-video mx-2"
        >
          <span
            className="badge bg-danger position-absolute rounded-circle"
            style={{ top: '-8px', right: '-8px' }}
          >
            {videosCount}
          </span>
        </button>
      </h3>

      {/* Modal: Saved Videos */}
      <div className="modal fade" id="library">
        <div className="modal-dialog modal-lg">
          <div className="modal-content">
            <div className="modal-header">
              <h4 className="text-primary">Your Saved Videos</h4>
              <button className="btn btn-close" data-bs-dismiss="modal"></button>
            </div>
            <div className="modal-body">
              {
                myLibrary.length === 0 ? (
                  <p className="text-muted">No saved videos yet.</p>
                ) : (
                  myLibrary.map(video => (
                    <div key={video.VideoId} className="mb-4">
                      <h6>{video.Title}</h6>
                      <iframe
                        src={video.URL} // âœ… Match casing with your API
                        width="100%"
                        height="200"
                        title={video.Title}
                      ></iframe>
                    </div>
                  ))
                )
              }
            </div>
          </div>
        </div>
      </div>

      {/* Videos List */}
      <section className="d-flex flex-wrap">
        {
          videos.map(video => (
            <div key={video.VideoId} className="card p-2 m-2" style={{ width: '400px' }}>
              <div className="card-header" style={{ height: '120px' }}>
                <h4>{video.Title}</h4>
              </div>
              <div className="card-body">
                <iframe
                  src={video.URL} // âœ… Match casing with API
                  width="100%"
                  height="200"
                  title={video.Title}
                ></iframe>
              </div>
              <div className="card-footer">
                <button
                  onClick={() => handleSaveClick(video)}
                  className="btn btn-primary me-2"
                >
                  Save
                </button>
                <span className="bi bi-hand-thumbs-up"></span> {video.Likes} Likes
                <div className="mt-2">
                  <label className="form-label fw-bold">Comments:</label>
                  <div>{video.Comments}</div>
                </div>
              </div>
            </div>
          ))
        }
      </section>
    </div>
  );
}
